import React, { ChangeEvent, Component, Fragment } from 'react'
import Header from '../../components/Header'
import './profile.css'
import AddCircleIcon from '@mui/icons-material/AddCircle';
import RemoveCircleIcon from '@mui/icons-material/RemoveCircle';
import { TextField } from '@mui/material';
import PostAddIcon from '@mui/icons-material/PostAdd';

type ProfileProps = {};

type ProfileState = {
}

export default class Profile extends Component<ProfileProps, ProfileState> {
  constructor(props: ProfileProps) {
    super(props);
    this.state = {
      title: "",
      description: "",
      hoursCount: 0,
      lecturerName: "",
      tagString: "",
      isClickedCreateNewPost: true,
      postList: [
      ],
    };
  }

  handleClickCreateNewPost = () => {
    this.setState((prevState) => ({
      ...prevState,
      isClickedCreateNewPost: !prevState.isClickedCreateNewPost,
    }));
  };

  handleSubmit = (event: React.FormEvent<HTMLFormElement>) => {
    event.preventDefault();
    console.log("Submitted");
  };

  handleInputChange = (event: ChangeEvent<HTMLInputElement>) => {
    console.log("Changed");
    console.log(event.target.value);

    // desctructuring assignment
    const { name, value } = event.target;

    this.setState((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  // clearState = () => {
  //   this.setState(prevState) => {
  //     ...prevState,
  //     []
  //   };
  // }




  render() {
    return (
      <Fragment>
        <Header/>
        <div className='mt-24 px-6'>
          {this.state.isClickedCreateNewPost ? (
            <>
            <div  className='cursor-pointer p-6 w-full rounded-lg bg-purple-900 shadow-lg hover:bg-purple-700 flex text-white font-bold justify-between items-center' onClick={this.handleClickCreateNewPost}>
              <h6 className='text-xl'>Create a Post</h6>
              <AddCircleIcon/>
            </div>
          </>

          ) : (
            <>
            <div className='cursor-pointer p-6 w-full rounded-t-lg bg-purple-900 shadow-lg hover:bg-purple-700 flex text-white font-bold justify-between items-center'  onClick={this.handleClickCreateNewPost}>
              <h6 className='text-xl'>Discard Post</h6>
              <RemoveCircleIcon/>
            </div>
            <div className='p-6 w-full rounded-b-lg bg-purple-100 shadow-lg flex text-black font-bold justify-between items-center'>
              <form className='w-full p-6 space-y-4'  onSubmit={this.handleSubmit}>
                <TextField className='bg-white rounded-md'
                 label="Post Title"
                 type="text"
                 variant="outlined"
                 name="title"
                 placeholder="Enter post title"
                 onChange={this.handleInputChange}
                 value={this.state.title}
                 fullWidth={true}
                 required
                />
                <TextField className='bg-white rounded-md'
                  label="Post Description"
                  type="text"
                  variant="outlined"
                  name="description"
                  placeholder="Enter post description"
                  value={this.state.description}
                  onChange={this.handleInputChange}
                  fullWidth={true}
                  multiline
                  minRows={5}
                  maxRows={Infinity}
                  required
                />
                <TextField className='bg-white rounded-md'
                 label="Hours Count"
                 type="number"
                 variant="outlined"
                 name="hoursCount"
                 placeholder="Enter hours count"
                 onChange={this.handleInputChange}
                 value={this.state.hoursCount}
                 fullWidth={true}
                />
                <TextField className='bg-white rounded-md'
                  label="Lecturer Name"
                  type="text"
                  variant="outlined"
                  placeholder="Enter Lecturer Name"
                  name="lecturerName"
                  onChange={this.handleInputChange}
                  value={this.state.lecturerName}
                  fullWidth={true}
                />
                <TextField className='bg-white rounded-md'
                  label="Tags (Comma separated tags)"
                  type="text"
                  variant="outlined"
                  name="tagString"
                  placeholder="Enter comma separated tags"
                  onChange={this.handleInputChange}
                  value={this.state.tagString}
                  fullWidth={true}
                  required
                />
                <button className='w-full px-4 py-2 tracking-wide text-white transition-colors duration-200 transform bg-purple-700 rounded-md hover:bg-purple-600 focus:outline-none focus:bg-purple-600'>
                  <PostAddIcon/>
                  Post
                </button>
              </form>
            </div>
          </>
          )}
        </div>
        <div className='p-6'>
        {this.state.postList.map((post) => (
          <Post
            key={post.id}
            title={post.title}
            description={post.description}
            tags={post.tag}
            hoursCount={post.hoursCount}
            lecturerName={post.lecturerName}
          />
        ))}
        </div>
      </Fragment>
    );
  }
}
